import React from 'react';
import {Link} from 'react-router-dom';
import {getCV} from "../api/apiCalls";

const CvListItem = (props) => {

    const {cv} = props;
    const {id, name, lastname, email, phone} = cv;

    return (
        <Link to={`/`} className="list-group-item list-group-item-action">
            <div className="table">
                <thead>
                <tr>
                    {/*<th scope="col">ID</th>*/}
                    {/*<th scope="col">NAME</th>*/}
                    {/*<th scope="col">LAST NAME</th>*/}
                    {/*<th scope="col">EMAIL</th>*/}
                    {/*<th scope="col">PHONE</th>*/}
                </tr>
                </thead>
                <tbody>
                <tr>
                    <th scope="row"></th>
                    <td scope="col" >{id}</td>
                    <td scope="col">{name}</td>
                    <td scope="col">{lastname}</td>
                    <td scope="col">{email}</td>
                    <td scope="col">{phone}</td>
                </tr>

                </tbody>

                {/*<div className="col-md-auto" >{id}</div>*/}
                {/*<div className="col-md-auto">{name}</div>*/}
                {/*<div className="col-md-auto">{lastname}</div>*/}
                {/*<div className="col-md-auto">{email}</div>*/}
                {/*<div className="col-md-auto"></div>*/}
            </div>

        </Link>
    );
};

export default CvListItem;
